WordPress ip站点迁移到域名站点过程July 5, 2015 • CentOSFTPLNMPVPSWordPress • ☕️ 1 min readtk顶级域名免费注册ip站点迁移到域名tk顶级域名免费注册节省篇幅，此处参考注册有延时，邮件没收到要耐心等一会哈。记得做好dns解析到你的ip哦~ip站点迁移到域名这里用到的还是这三个命令，还记得嘛？lnmp vhost {add|list|del}
值得注意的是首先登陆WordPress后台，【设置】>【常规】将其中的WordPress地址和站点地址都改成你的www域名。然后运行lnmp vhost del     #删除ip vhost
lnmp vhost add     #添加站点www域名
-记得要添加两个哦，一个是“www.域名.com”，另一个是“域名.com”哈。依然设置成伪静态和wordpress哦接下来是目录迁移带权限cp -R /home/wwwroot/ip* /home/wwwroot/域名
然后进入/home/wwwroot/域名目录，修改那个带“i”标志的.user.ini文件，这个文件是在lnmp vhost add时候系统生成的呢所以每次add都要修改哈。修改的过程复习一下：因为.user.ini文件无法直接修改修改前需要执行：chattr -i .user.ini
修改完成后再执行：chattr +i .user.ini
登陆看看ftp是否正常了呢，测试一下安装新插件，如果提示写入读取出错思密达就试试删除  目录下wp-config.php中的define("FS_METHOD","direct");
define("FS_CHMOD_DIR", 0777);
define("FS_CHMOD_FILE", 0777);
我在删除之后就正常了哦。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← Vagrant初体验CentOS6 VPS安装LNMP+WordPress ip建站全过程 →

posts/2019-12-11-cra-polyfill.text:
CRA polyfill（未完工）December 11, 2019 • reactbabel • ☕️ 1 min read1、生成一个精确支持浏览器的包（CRA官方姿势）babel-preset-envbrowserslist2、按需加载polyfill（todo）浏览器兼容性是老生常谈了，以往都是直接引入babel-polyfill完事。这样造成包体积变大了很多，因为照顾少数浏览器的体验而使得优秀的浏览器体验也跟着变差了。
以create-react-app为例，本文探讨目前polyfill的几种姿势。1、生成一个精确支持浏览器的包（CRA官方姿势） 纵观CRA文档浏览器支持部分。看完可能不清楚“Supported Language Features”和“Configuring Supported Browsers“为什么会分两节来叙述。其实这两节的内在逻辑是““Supported Language Features”是提供了polyfill，“Configuring Supported Browsers“是按需（目标浏览器的支持度）裁剪了polyfill的内容。也就是前者是全集（直接引入全部补丁），后者是子集（干掉浏览器已经支持的补丁）。需要做两件事：
1、在entrypint（即在index.tsx中）导入core-js（第一节的内容）
2、配置好正确的browserlist（第二节的内容）babel-preset-env会做类似以下的事情In:import "core-js";
Out (different based on environment):import "core-js/modules/es.string.pad-start";
import "core-js/modules/es.string.pad-end";
browserslist帮助筛选polyfill的去留。"browserslist": {
        "production": [
            ">0.2%",
            "not dead",
            "not op_mini all",
            "ios_saf 10"
        ],
        "development": [
            "last 1 chrome version",
            "last 1 firefox version",
            "last 1 safari version"
        ]
    }
这个站点,可以直观的帮助我们看到适配的浏览器。两者的互动关系，具体的实现有待研究（todo）2、按需加载polyfill（todo）OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← React遇到disqusStart Loving Change →

posts/2020-08-28-HTTP-headers.text:
在HTTP headers中传递认证信息的方法分析August 28, 2020 • networkcookie • ☕️ 1 min read你可以从本文了解到为什么要在 headers 中传递认证信息Cookie 中写入认证信息名词解释在 headers 中携带你可以从本文了解到为什么要在 headers 中传递认证信息有哪些方案，各自优缺点如何为什么要在 headers 中传递认证信息可视为独立的一层身份控制机制，后台可以加在某个域的根 controller 下面，根据用户身份“分发”给为不同身份的人设计的不同的子 controller 处理。那么 HTTP 报文的 header 中可以加认证信息的地方主要有 cookie 和自定义字段这两种位置了。（不考虑在 query 中带身份信息）以下只讨论由客户端写入认证信息的场景。Cookie 中写入认证信息众所周知，Cookie 在 Chrome80 后，对三方 Cookie 策略进行了调整。名词解释First-party cookie匹配用户当前访问站点（浏览器地址栏 URI）的域名 cookie如：用户访问 vredu.baidu.com，页面中*.baidu.com 的请求会携带.baidu.com 域下的 cookie，为 first-party cookieThird-party cookie（第三方 cookie）非 first-party cookie如：百度统计（hm.baidu.com）收到的请求，来自于用户访问第三方站点 kuaishou.com 的页面中嵌入的百度统计的链接，此时.baidu.com 域下的 cookie 就是 third-party cookie本地起 devServer 所代理的域名是 Ac.baidu.com
假如开发环境的后台服务器域名是 Ba.b.baidu.com在这种情况下，由请求 B 得到的 token 写入 A 的 cookie。这导致再次请求 B，在非 https 环境下，这次第三方 cookie 传递将会被浏览器阻断。在 headers 中携带思路很清晰，把 token 放到 headers 单独成一个字段。但在 umi-request/axios 等网络库中，无论是通过 request.interceptors 或者 extendOptions 都无法请求成功，cookie 会弄丢。经过对 XMLHttpRequest 相关请求发起过程的研究，Axios 源码和MDN告诉我们，需要服务器指定 Access-Control-Allow-Headers 才可以，否则会在 preflight 阶段被拒绝。// Add headers to the request
if ('setRequestHeader' in request) {
    utils.forEach(requestHeaders, function setRequestHeader(val, key) {
        if (
            typeof requestData === 'undefined' &&
            key.toLowerCase() === 'content-type'
        ) {
            // Remove Content-Type if data is undefined
            delete requestHeaders[key];
        } else {
            // Otherwise add header to the request
            request.setRequestHeader(key, val);
        }
    });
}
后台同学进行了配置之后，请求成功了。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← performance optimize rethinktheme switch →

posts/2016-08-28-angular-component-ui-ro.text:
angularJS 1.5 component与ui-router的结合August 28, 2016 • angularJS • ☕️ 1 min read准备工作引入component传统写法component参数指定name:bindings对象的形式参考文献准备工作为了正常使用component的新特性和顺利结合进angular-ui-router，先检查依赖。（angular-ui-router版本太低会导致传参数入component在$resolve的时候无效，哎，都是泪T_T，本宝宝以为只要angular版本高于1.5就行了，结果折腾了半天发现angular-ui-router也要对应更新）主要的依赖需求是："angular": "^1.5.8",    
"angular-ui-router": "^1.0.0"
引入component首先假如定义如下的元件：app.component('myComponent', {
    templateUrl: 'myComponent.html',
    controller: 'MyController',
    bindings: { input1: '<', input2: '<' }
});
传统写法使用template，通过$resolve传递数据。（本宝宝喜欢这个方法，在component实例化之前用promise的方式取数据，很强大！）$stateProvider.state('foo', {
  template: '<my-component input1="$resolve.foo" input2="$resolve.bar"></my-component>',
  url: '/foo/:fooId/:barId',
  resolve: {
    foo: ($stateParams, FooService) => FooService.get($stateParams.fooId),
    bar: ($stateParams, BarService) => BarService.get($stateParams.barId)
  } 
});
component参数指定$stateProvider.state('foo', {
  component: 'myComponent',
  url: '/foo/:fooId/:barId',
  resolve: {
    // input1 and input2 are same names as myComponent `bindings`
    input1: ($stateParams, FooService) => FooService.get($stateParams.fooId),
    input2: ($stateParams, BarService) => BarService.get($stateParams.barId)
  } 
});
name:bindings对象的形式$stateProvider.state('foo', {
  component: 'myComponent',
  bindings: { input1: "foo", input2: "bar" },
  url: '/foo/:fooId/:barId',
  resolve: {
    foo: ($stateParams, FooService) => FooService.get($stateParams.fooId),
    bar: ($stateParams, BarService) => BarService.get($stateParams.barId)
  } 
});
