posts/2018-04-09-js-css-text-overflow.text:
关于文本缩略April 9, 2018 • cssjs • ☕️ 1 min read需求描述纯 CSS 的方案（推荐）纯 JS 的方案（不推荐）需求描述一个不定宽度的 div，其中的文本当超出 div 宽度时候自动缩略成…中英文混排纯 CSS 的方案（推荐）div{
    overflow: 'hidden',
    whiteSpace: 'nowrap',
    textOverflow: 'ellipsis'
}
textOverflow 这个属性，有“clip|ellipsis|string”三种属性，作用分别如下值描述clip修剪文本。ellipsis显示省略符号来代表被修剪的文本。string使用给定的字符串来代表被修剪的文本。纯 JS 的方案（不推荐）JS 在实现这块就显得比较不便，首先，仅仅根据字符数量进行截取，不能很好适应动态的 div 宽度。这里仅给出固定宽度（rem 定义 div 宽度）下可能的办法（但是没法保证不同浏览器和不同默认字体下的一致性）。下面这个 sub 函数就是截取固定长度（先把中文统一转成英文字符计算宽度）。String.prototype.len = function() {
    return this.replace(/[^\x00-\xff]/g, 'rr').length;
};
String.prototype.sub = function(n) {
    let r = /[^\x00-\xff]/g;
    if (this.replace(r, 'mm').length <= n) {
        return this;
    }
    // n = n - 3;
    let m = Math.floor(n / 2);
    for (let i = m; i < this.length; i++) {
        if (this.substr(0, i).replace(r, 'mm').length >= n) {
            return this.substr(0, i) + '...';
        }
    }
    return this;
};
