聊聊字体加载July 10, 2018 • fontcssjavascript • ☕️ 1 min read自定义字体Javascript 控制字体的载入Font Face ObserverCSS 控制字体的载入font-display最佳选择Refs自定义字体通常自定义字体在 css 中用@font-face 定义
加载方式是懒加载。（即用到的时候才会开始下载）<html>
<head>
  <title>Web Font Sample</title>
  <style type="text/css" media="screen, print">
    @font-face {
      font-family: "Bitstream Vera Serif Bold";
      src: url("https://mdn.mozillademos.org/files/2468/VeraSeBd.ttf");
    }

    body { font-family: "Bitstream Vera Serif Bold", serif }
  </style>
</head>
<body>
  This is Bitstream Vera Serif Bold.
</body>
</html>
Javascript 控制字体的载入Font Face Observervar font = new FontFaceObserver('Source Han Sans');

font.load('中国').then(function() {
    console.log('Source Han Sans has available');
});
加载模式举例web-font-loading-patternsBa­sic font load­ingLoad­ing groups of fontsLoad­ing fonts with a time­outPri­ori­tised load­ingCus­tom font dis­playOp­ti­mise for cachingCSS 控制字体的载入font-display时间线阶段作用block字体未加载，用到该字体的元素必须实现 invisible 回落，在此期间如果下载完成，则正常显示swap字体未加载，用到该字体的元素必须有一种回落字体，在此期间如果下载完成，则正常显示failure字体加载失败，调用回落字体属性值和意义/* Keyword values */
font-display: auto|block|swap|fallback|optional;
值解释autoThe font display strategy is defined by the user agentblockGives the font face a short block period and an infinite swap period.swapGives the font face an extremely small block period and an infinite swap period.fallbackGives the font face an extremely small block period and a short swap period.optionalGives the font face an extremely small block period and no swap period.兼容性safari，chrome>60最佳选择font-display: swap;Refsfontfaceobserver
