posts/2020-06-30-how-to-build-screen-pro.text:
用WebRTC构建投屏应用June 30, 2020 • WebRTC • ☕️ 1 min read你可以从本文了解到本文背景用WebRTC构建屏幕分享应用对端发现与信令服务器在信令之后：使用 ICE来对付NAT和防火墙STUNTURNRefs你可以从本文了解到本文背景用WebRTC构建屏幕分享应用 本文对应的代码在此。本文背景首先，本文不是WebRTC零基础教程。记录和分享在编写屏幕分享demo时候遇到的问题。代码的master分支是修改自building-a-video-chat-in-javascript，develop分支对协议进行了重构和模块化改进，并增加各种清理能力。用WebRTC构建屏幕分享应用我们的场景是1个教师(A)，1个学生端(B)。老师可以发起投屏，看到学生屏幕内容。值得注意的是，webrtc属于点对点双向通信，谁是主叫方本身并不重要。【基于交互考量】由于学生端在业务场景下有可能存在抢占的情况，即B在跟A1投屏，此时A2要抢占，为了得知B是否被占用，所以A先试探性的问一下B是不是忙，从而避免无意中抢占正在投屏的设备。因此，我们选择三步走：A试探B（或者抢占通知），B主动（或者断开前一个连接），A确认。完整的offer/answer机制如下：A 告知 B 要开始投屏了(A --> B)B 创建一个RTCPeerConnection对象，使用.createOffer()方法产生一个offer（一个SDP会话描述）B 用他的offer调用setLocalDescription()B 将offer字符串化，并使用信令机制将其发送给A(A <-- B)A用B的offer调用setRemoteDescription()，以便她的RTCPeerConnection知道B的设置。A调用createAnswer()，成功的回调是传入一个本地的会话描述：A的answer。通过调用setLocalDescription()将其answer设置为本地描述。A然后使用信令机制将她的字符串化的answer发回给B(A --> B)。B使用setRemoteDescription()将A的应答设置为远程会话描述AB还需要交换网路信息，“查找候选人（find candidate）”这个表达是指使用ICE框架查找网络接口和端口的过程。A 创建一个RTCPeerConnection对象，绑定handler监听icecandidate事件。当A从B那里获得候选消息时，她调用addIceCandidate()，将候选项添加列表中。(A <-- B)在handler中，A通过他们的信令通道将字符串化的候选数据发送给B。(A --> B)B做类似的处理，调用addIceCandidate()，将候选项添加列表中JSEP支持ICE Candidate Trickling，它允许主叫方(caller)在最初的offer之后递增地向被叫方提供候选项（candidates），并使被叫方开始在通话中进行操作并建立连接而不用等所有候选项到达。⚠️下图中，左边认为是B，右边是A。（忽略括号中的AB）对端发现与信令服务器可以用任何消息服务实现，比如websocket，mqtt等。在信令之后：使用 ICE来对付NAT和防火墙对于元数据信令，WebRTC应用程序使用中介服务器，但对于实际的媒体和数据流，一旦建立对话的话，RTCPeerConnection就会尝试点对点地直接连接客户端。在简单的情况中，每个WebRTC端点都有一个唯一的地址，可以与其他端进行交换以便直接通信。
实际上大多数设备都是处在一层或者多层NAT之后的，其中有一些包含可以阻挡某些端口和协议的防病毒软件，还有很多设备是在代理和公司防火墙之后的。防火墙和NAT实际上可以由相同的设备实现，比如说家庭WiFi路由器。
WebRTC应用程序可以使用ICE框架来消除实际网络的复杂性。为了实现这一点，你的应用程序必须将 ICE服务器的URL传递给RTCPeerConnection，就像下面所描述的那样。ICE试图找到连接对方的最佳途径。它会并行地尝试所有可能性，并选择最有效的选项。 ICE首先尝试使用从设备操作系统和网卡获取的主机地址进行连接；如果不成功的话（对于NAT后面的设备就会失败）， ICE会使用 STUN服务器获取外部地址，如果还是失败的话，则通过 TURN中继服务器路由数据。换句话说：STUN服务器是用来获取外部地址的。TURN服务器是用来在直接连接（点到点）失败的情况下进行中继数据流量的每个 TURN服务器都支持 STUN： TURN服务器也是一个增加了内置中继功能的 STUN服务器。 ICE还可以应付NAT设置的复杂性：实际上，NAT“打孔”可能不仅仅需要一个公共IP:端口地址。STUN 和/或 TURN服务器的URL（可选择地）由iceServers配置对象中的WebRTC应用程序指定，该配置对象是RTCPeerConnection构造函数的第一个参数。对于本项目来说，值看起来是这样的const webrtc = new RTCPeerConnection({
      iceServers: [
        {
          urls: ["stun:stun.stunprotocol.org"],
        },
        {
          url: "turn:relay.backups.cz",
          credential: "webrtc",
          username: "webrtc",
        },
        {
          url: "turn:relay.backups.cz?transport=tcp",
          credential: "webrtc",
          username: "webrtc",
        },
      ],
    });
一旦RTCPeerConnection具有该信息， ICE的作用就会自动发生：RTCPeerConnection使用 ICE框架 来计算到对端之间的最佳路径，并根据需要使用 STUN和 TURN服务器。STUNNAT给设备提供了一个IP地址以使用专用局域网，但是这个地址不能在外部使用。由于没有公用地址，WebRTC端对端就无法进行通信。而WebRTC使用STUN来解决这个问题。STUN服务器位于公共网络上，并且有一个简单的任务：检查传入请求的IP地址（来自运行在NAT后面的应用程序），并将该地址作为响应发送回去。换句话说，应用程序使用 STUN服务器从公共角度发现其IP:端口。这个过程使得WebRTC一端为自己获得一个可公开访问的地址，然后通过信令机制将其传递给另一端以建立直接连接。（实际上不同NAT工作方式都有所不同，可能有多个NAT层，但是原理是一样的）。因为 STUN服务器不需要做太多的工作或者记特别多的东西，所以相对低规格的 STUN服务器就可以处理大量的请求。根据webrtcstats.com的统计（2013年），大多数WebRTC通话都成功地使用 STUN进行连接，有86%。尽管对于防火墙之后的两端之间的呼叫以及复杂的NAT配置，成功通话量会更少一些。
TURNRTCPeerConnection尝试通过UDP建立对等端之间的直接通信。如果失败的话，RTCPeerConnection就会使用TCP进行连接。如果使用TCP还失败的话，可以用 TURN服务器作为后备，在终端之间转发数据。重申： TURN用于中继对等端之间的音频/视频/数据流，而不是信令数据。TURN服务器具有公共地址，因此即使对等端位于防火墙或代理之后也可以与其他人联系。 TURN服务器有一个概念上来讲简单的任务—中继数据流—但是与 STUN服务器不同的是，他们会消耗大量的带宽。换句话说， TURN服务器需要更加的强大。
上图显示了 TURN的作用：单纯的 STUN没有成功建立连接，所以每个对等端还需要使用 TURN服务器。关于如何搭建STUN和TURN服务器参见真实世界中的WebRTC：STUN, TURN and signalingRefsbuilding-a-video-chat-in-javascriptwhat-is-webrtc-and-how-to-setup-stun-turn-server-for-webrtc-communicationWebRTC：连接建立过程的网络穿透真实世界中的WebRTC：STUN, TURN and signalingOverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← 用hygen代码生成器优化效率当velop有线回程遇到了智能家居的那点事 →

posts/2020-06-30-hygen.text:
用hygen代码生成器优化效率June 30, 2020 • reacthygen • ☕️ 1 min read你可以从本文了解到背景为什么要用代码生成器我所做的工作hygen安装和初始化调试编写模板，数据处理增加cli交互提示整合到npm script总结你可以从本文了解到为什么要用代码生成器hygen如何使用来提高工作效率背景最初是因为换了基于create-react-blog的框架，这是一个比较素的框架（相比其他带cli的框架而言），每次写新post需要创建1个文件夹和两个文件，并填充一堆信息，非常繁琐，即使可以复制粘贴。但是，这种创作体验并不理想，让写作的人决定自己的新post是基于旧post改改而来的，体验不纯粹。因为创作门槛比原来高，所以创作的热情相对而言更低了。当我站在2020年6月30日回看这半年一篇都没有发表，我着实决定这个事情到了不得不做的地步。不是难，只是懒。我要用一小段的调研和开发，降低创作启动门槛。为什么要用代码生成器这是一个js工程，有着丰富的node工具链生态，我们可以基于开源的代码生成器，打造属于这个项目的定制代码生成器。hygen就是本文选择的(谷歌query：node cli code generator)。【todo：hygen源码分析】我所做的工作将hygen安装和初始化调试编写模板，数据处理增加cli交互提示整合到npm script下面分步介绍hygen安装和初始化yarn add hygen //依赖安装到项目维度
./node_modules/.bin/hygen init self // 在项目中初始化hygen
./node_modules/.bin/hygen generator new post // 创建叫post的generator
调试编写模板，数据处理以本工程为例，在_templates/post下新增文件_templates
├── generator
│   ├── help
│   │   └── index.ejs.t
│   ├── new
│   │   └── hello.ejs.t
│   └── with-prompt
│       ├── hello.ejs.t
│       └── prompt.ejs.t
└── post
    └── new
        ├── document.ejs.t   /* ADDED */
        ├── post.ejs.t       /* ADDED */
        └── prompt.js        /* ADDED */
以post.ejs.t为例，这个文件包含了一个post的元数据，编写如下---
to: src/routes/posts/<%= h.getDate() + '-' + h.inflection.dasherize(title) %>/post.ts
---
export default {
    title: '<%= title%>',
    tags: <%- JSON.stringify(tags.split(',')) %>, // 进行了序列化和unescape
    spoiler: '<%= spoiler%>',
    getContent: () => import('./document.mdx'),
}
这里h.inflection.dasherize用到了内置helper函数来处理文件名，而h.getDate()则是我们扩展的helper函数（定义在项目根目录的.hygen.js文件中），用户获取日期字符串，示例如下：// .hygen.js
module.exports = {
    helpers: {
        getDate: () => {
            let d = new Date()
            let year = d.getFullYear();
            let month = d.getMonth() + 1;
            let day = d.getDate();
            return `${year}/${month}/${day}` // 斜线代表文件夹层级
        }
    }
}
此时我就可以使用如下命令创建post了./node_modules/.bin/hygen post new --title title --spoiler spoiler --tags tag1,tag2
增加cli交互提示为了减少用户的记忆点，我们可以采用交互式输入框，这就是prompt.js文件起到的作用了，其中定义了我们需要用户输入的元数据。// _templates/post/new/prompt.js
module.exports = [
    {
        type: 'input',
        name: 'title',
        message: "What's your post's title?"
    },
    {
        type: 'input',
        name: 'spoiler',
        message: "What's your post's spoiler?"
    },
    {
        type: 'input',
        name: 'tags',
        message: "What's your post's tags?"
    }
]
整合到npm script最后，再精简用户的记忆点，将生成器的脚本整合到package.json文件中。{
    //...
  "scripts": {
    //...
    "create": "hygen post new" // ADDED
  },
}
总结整个代码生成器的定制工作的核心出发点就是减少一切记忆点，对用户的干扰和分心减少到最低，使创作者专注于内容创作而不是编写代码。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← theme switch用WebRTC构建投屏应用 →

posts/2020-07-08-theme-switch.text:
theme switchJuly 8, 2020 • reactcss • ☕️ 1 min read你可以从本文了解到缘起N种方式link.href切换styled-components ThemeProvider切换CSS var切换你可以从本文了解到夜间模式/主题切换缘起之所以想起“夜间模式”这个主题，是因为看到了这篇文章，而且这个主题已经躺在我的todoList里面很久了。N种方式我梳理了一下主要有以下几种主题切换方式link.href切换适用场景：没有采用预编译，样式可以通过文件级别隔离。例如上面文章中的示例：function switchSheet() {
  let theme = document.getElementById("theme");

  if (theme.getAttribute("href") == "light-mode.css") {
    theme.href = "dark-mode.css";
  } else {
    theme.href = "light-mode.css";
  }
}
styled-components ThemeProvider切换适用场景：工程基于styled-components，样式采用全局theme值。CSS var切换适用场景：基于css module或者SCSS之类，样式可以采用全局定义的css variable，通过切换body的class进行切换。以本blog工程的改造为例，示例如下：/* index.module.css */
:global body.light{
  --bg: #fff;
  --textNormal: #222;
  --textTitle: black;
}
:global body.dark{
  --bg: #282c35;
  --textNormal: hsla(0,0%,100%,0.88);
  --textTitle: #fff;
  --primary-color: rgb(255, 167, 196);
}
:global body {
/* ... */
  background-color: var(--bg);
  color: var(--textNormal);
}
class ThemeService {
    constructor() {}
    // app挂载时读取并应用上次的theme
    syncTheme() {
        const theme = this.getTheme();
        document.body.setAttribute('class', theme);
    }
    // 设定theme并持久化
    setTheme(theme) {
        localStorage.setItem('theme', theme);
        document.body.setAttribute('class', theme);
    }
    // 读取定制的theme，给默认值light
    getTheme() {
        return localStorage.getItem('theme') || 'light';
    }
}

export default new ThemeService();
