posts/2022-01-19-1400-for-await-...-of.text:
for await ... ofJanuary 19, 2022 • js • ☕️ 1 min read你可以从本文了解到背景首先谁在用这个写法小节你可以从本文了解到背景在看vercel/cli代码的时候什么看到了比较少见的用法。是for await of与generator的结合。稍后会 demo 来说明。首先谁在用这个写法在代码搜索平台sourcegraph上搜索关键字for await (const，可以看到有 n 多大型项目在用。我们来看 stars 排名第一的 puppeteer 的代码，可以看出这部分是以流的方式分片读取chunk存入buffer。async function getReadableAsBuffer(
    readable: Readable,
    path?: string
): Promise<Buffer> {
    if (!isNode && path) {
        throw new Error(
            'Cannot write to a path outside of Node.js environment.'
        );
    }

    const fs = isNode ? await importFSModule() : null;

    let fileHandle: import('fs').promises.FileHandle;

    if (path && fs) {
        fileHandle = await fs.promises.open(path, 'w');
    }
    const buffers = [];
    for await (const chunk of readable) {        buffers.push(chunk);
        if (fileHandle) {
            await fs.promises.writeFile(fileHandle, chunk);
        }
    }

    if (path) await fileHandle.close();
    let resultBuffer = null;
    try {
        resultBuffer = Buffer.concat(buffers);
    } finally {
        return resultBuffer;
    }
}
其他的例子也都差不多，基本模式也就是语法所定义的。of后面接iterable对象（通常是数组、迭代器等等），puppeteer里面用的是数组。vercel用的是iterator。for await (variable of iterable) {
  statement
}
那么来看看vercel的iterator用法。值得注意的是这是一个cli应用，所有的操作都需要通过屏幕输出给用户进行到哪一步了。为了清晰期间去掉了业务代码，抽象成以下最简demo。其main函数是在执行一段代码createSomething的时候中途去执行另一段代码createOtherStuff，再回来继续执行createSomething。可以看到这个模式有一个特点，yield出来的消息最终都抛到了main函数，有一种事件集线器的效果。async function main() {
    for await (const event of createSomething()) {
        console.log(event);
    // update spinner/indicator
    }
}

async function* createSomething() {
    yield 'createSomething-1';
    yield 'createSomething-2';
    for await (const event of createOtherStuff()) {
        yield event;
    }
    yield 'event-done';
}

async function* createOtherStuff() {
    yield 'createOtherStuff-1';
    yield 'createOtherStuff-2';
    yield 'createOtherStuff-done';
}

main();
小节这是一个很有趣但是很强大的写法，希望之后有机会能再项目中用上。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to ChangeiCopy release new version →

posts/2019-02-01-cra-ts.text:
当create-react-app遇上typescriptFebruary 1, 2019 • reacttypescript • ☕️ 2 min read背景步骤拆解1、升级 cra 版本2、重命名文件名3、启动项目4、快捷安装 typings5、修复所有编译错误一个 比较复杂的带有 redux 的 react 组件的通常 ts 写法absolute 引用的解决方案总结Refs背景2018 年以来的跑了许久的 react 项目，一直是基于 cra（create-react-app）官方脚手架并且不 eject，通过 react-app-rewired 进行自定义配置的。当时虽然有不少第三方的 ts（typescript）化方案，但不少官方支持且需要 eject 且需要第三方 ts loader，所以都在可升级性上有硬伤。而快到年底的时候，Babel7 出来，并且 babel 官方支持 typescript，与此同时 Facebook 将 cra2.0 加入了 ts 的支持，支持生成 ts 项目(cra-doc)。本文尝试将我们工程的升级过程和采坑进行总结和分享。原工程主要配置是create-react-app (1.x )flowreact-app-rewired (1.x)目标升级后的配置是create-react-app (2.x )typescriptreact-app-rewired (2.x)步骤拆解1、升级 cra 版本首先升级react-scripts react-app-rewired到 2.x 版本2、重命名文件名将 src 下的 js 和 jsx 文件改成 tsx 文件。可以利用find ./src -name "*.jsx" -exec sh -c 'mv "$0" "${0%.jsx}.tsx"' {} \;和find ./src -name "*.js" -exec sh -c 'mv "$0" "${0%.jsx}.tsx"' {} \;两条指令。3、启动项目运行npm start，cra 会检测到项目是 typescript 工程然后为你产生一个 tsconfig.json 文件。建议将 compilerOptions 的 strict 值改成 false，以避免过分严格的 any 检查导致项目编不过。这个文件大致长这样:{
    "compilerOptions": {
        "target": "es5",
        "lib": ["dom", "dom.iterable", "esnext"],
        "allowJs": true,
        "skipLibCheck": true,
        "esModuleInterop": true,
        "allowSyntheticDefaultImports": true,
        "strict": false, // default is true
        "forceConsistentCasingInFileNames": true,
        "module": "esnext",
        "moduleResolution": "node",
        "resolveJsonModule": true,
        "isolatedModules": true,
        "noEmit": true,
        "jsx": "preserve"
    },
    "include": ["src"]
}
4、快捷安装 typings可以全局安装types-installer来进行自动化的依赖解析和安装。$ npm i -g types-installer
$ types-installer
5、修复所有编译错误这是工作量最大也是最复杂的步骤。根据工程文件多少可能会花费 1 天到若干天的工作量。但既然选择了开始，就请坚信结果是美好的。一个 比较复杂的带有 redux 的 react 组件的通常 ts 写法这里 redux 的 state 和 dispatch 的 any 声明是可以通过引入 store 文件来实现的，偷懒了。RouteComponentProps 是为了 withRouter 可以正确识别 this.props.history 等 react-router 属性。CSSProperties 是为了让 style 对象可以正确被识别。当然工程中用的是 styled-components 就不需要这条了。import React, {Component, CSSProperties} from 'react';
import {Route, withRouter, RouteComponentProps} from 'react-router-dom';
import {connect} from 'react-redux';
interface OwnProps {}
interface StateProps {}
interface DispatchProps {}
type Props = OwnProps & StateProps & DispatchProps & RouteComponentProps;
type State = {};
class Hello extends Component<Props, State> {
    state: State = {};
    static defaultProps = {};
    render() {
        const myStyle = {
            background: 'red'
        } as CSSProperties;
        return <div style={myStyle}>hellow</div>;
    }
}
const mapStateToProps = (state: any) => ({
    state
});
const mapDispatchToProps = (dispatch: any) => ({dispatch});
export default connect(
    mapStateToProps,
    mapDispatchToProps
)(withRouter(Hellow));
absolute 引用的解决方案在通常的工程中，我们会设定 alias 来方便绝对地址的引用，比如用@记号来指向 src 路径。通常在 config-overrides 里面这么配置module.exports = {
    webpack: function(config, env) {
        config.resolve = {
            ...config.resolve,
            alias: {
                '@': path.resolve(__dirname, 'src')
            }
        };
    }
};
这个在 cra 的 typescript 工程中编译是可以的，但 typescript 解析器默认是不支持的（会出现红色波浪线告诉你@无法识别），通过改 tsconfig 的方法并没有得到官方的支持。经过探索和试验，目前最完美的方案就是软链接src路径到node_modules/@。而且以后官方支持配置之后，也可以方便的切过去。对 package.json 部分配置如下。{
    "scripts": {
        "postinstall": "yarn link-modules",
        "unlink-modules": "rimraf node_modules/@",
        "link-modules": "globstar --node -- lnk \"./src/*\" \"./node_modules/@/\"",
        "relink-modules": "yarn unlink-modules && yarn link-modules"
    }
}
需要的依赖则可以用指令安装:yarn add -D rimraf lnk-cli globstar
现在只要运行yarn或者npm i 就会自动链接src到node_modules/@了。总结typescript 在复杂大型企业项目中越来越体现出其优势，我们将会坚定不移的转到 typescript 上来。RefsTypescript Tips Series: Proper Typing of react-redux Connected Components
