posts/2019-02-03-defining-component-apis.text:
如何更好的定义React组件APIFebruary 3, 2019 • reactcomponent • ☕️ 2 min read背景组件 API 建议尽可能最小化 API 暴露数量易于检索的目录结构避免写 renderXXX 类似的方法在数据边界拆分组件避免为了重用组件而写笨重的组件 reusable ！== flexible用 composition避免用枚举值做布尔值 props保持 props API 平行寻求团队建议Refs背景经过一段时间的 React 项目开发，写了不少的组件，也踩过不少的坑。本文学习整理了一些觉得比较实用的组件 API 编写的建议。组件 API 建议尽可能最小化 API 暴露数量这意味着更少的学习成本，让其他人更容易理解和使用。易于检索的目录结构不要过早的组织层次复杂的目录结构，在组件数量并不多的时候这么做是吃力不讨好。扁平的目录结构天生拥有字母顺序检索优势，便于其他人检索。避免写 renderXXX 类似的方法大部分的 render 开头的函数大概率可能应该自身是一个组件。// Instead of this
class Items extends React.Component {
  renderItems ({ items }) {
    return items.map(item => (
      <li key={item.id}>
        {renderItem(item)}
      </li>
    ))
  }

  renderItem (item) {
    return (
      <div>
        {item.name}
      </div>
    )
  }

  render () {
    return (
      <ul>
        {renderItems(this.props)
      </ul>
    )
  }
}
// Do this
const ItemList = ({ items }) =>
  <ul>
    {items.map(item => (
      <li key={item.id}>
        <Item {...item} />
      </li>
    )}
  </ul>

const Item = ({ name }) =>
  <div>{item.name}</div>

class Items extends React.Component {
  render () {
    const { items } = this.props
    return <ItemList items={items} />
  }
}
在数据边界拆分组件一些普通展示类组件的 API，通常应当由其数据模型来定义，而不是分开来传 props。// Instead of this
<Card
  image={product.thumbnail}
  title={product.name}
  text={product.description}
  link={product.permalink}
/>

// Do this
<ProductCard {...product} />
很可能 ProductCard 并不能复用，那么只留这么一份定义就可以了。你可以遵循“Rule of three”，也就是假如同样的逻辑在代码中出现了 3 次，就重构这个东西吧。避免为了重用组件而写笨重的组件 reusable ！== flexible别为了避免写一个新的组件，而给一个组件增加抽象属性和额外逻辑。例如，一个 Button 可能可以接受不同的 color，size，shape，但没必要每次都传一堆 props 组合进去，所谓Apropcalypse。// Instead of this
<Button
  variant='secondary'
  size='large'
  outline
  label='Buy Now'
  icon='shoppingBag'
  onClick={handleClick}
/>

// Do this
<SecondaryButton
  size='large'
  onClick={handleClick}>
  <Icon name='shoppingBag' />
  Buy Now
</SecondaryButton>
用 composition要尽量用 composition 的方式而不是 inherit 的方式，保证组件的灵活性。不要重复发明 props.children。如果定义的 props 接受的文字而不是基于数据结构，可能用 composition 是更好的方式。// Instead of this
<Header
  title='Hello'
  subhead='This is a header'
  text='And it has arbitrary props'
/>

// Do this
<Header>
  <Heading>Hello</Heading>
  <Subhead>This is a header</Subhead>
  <Text>And it uses composition</Text>
</Header>
采用 composition 的方式，就不需要那么多的 documentation 了。你也可以将 composition 版本的组件绑定到某种数据模型，就像这样。const PageHeader = ({
  title,
  description
}) =>
  <Header>
    <Heading>{title}</Heading>
    <Text>{description}</Text>
  </Header>

// And ideally can be used like this
<PageHeader {...page} />
避免用枚举值做布尔值 props布尔值作为 props 有时候会令人困惑，例如<Button primary />
<Button secondary />
那么这样会怎样?<Button primary secondary />
这样一来不看文档就真看不懂了。因此可以尝试下面的方式<Button variant="primary" />
虽然多打了几个字，但更具可读性。保持 props API 平行尽量保持不同组件间取同样名字的 props，这样更容易猜测用法和记住名称。// Instead of this
<DatePicker
  date={date}
  onSelect={handleDateChange}
/>

// Do this
<DatePicker
  value={date}
  onChange={handleDateChange}
/>
Styled System 库鼓励多个组件采用平行的 props API。例如 color 在 rebass 库的所有组件中都有同样的效果。// example from Rebass
<Box color='tomato' />
<Heading color='tomato' />
寻求团队建议以上的建议并不适用于所有需求，需要针对业务做灵活的变化。最好的建议是跟团队讨论，创建 RFCs 和 PRs，并尝试Readme Driven Development。写 React 组件很容易，但为团队创建一个好用的组件库值得花时间和努力去把事情做对。RefsDefining Component APIs in Reactthinking-in-reactRule of threeApropcalypse(强烈推荐)OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← 一种基于styled-components生态的react组件库设计构想当create-react-app遇上typescript →

posts/2019-12-29-disqus-addon.text:
React遇到disqusDecember 29, 2019 • reactdisqus • ☕️ 1 min read步骤概述注册账号安装和配置 disqus-react总结本文是填坑之作步骤概述注册Disqus 账号，新建一个 site。React 工程安装disqus-react组件，配置组件。注册账号注册的过程就不详细说了，就是注册完了之后要去对应 site 设定Website URL字段设置菜单的路径位于https://[你的siteShortname].disqus.com/admin/settings/general/安装和配置 disqus-react用 yarn 安装依赖yarn add disqus-react
然后配置页面组件，本工程为例，页面组件在src/components/BlogPostLayout.tsx
重点是NEW_CODE标记的import React from 'react';
import {Link, useCurrentRoute, useView} from 'react-navi';
import {MDXProvider} from '@mdx-js/react';
import siteMetadata from '../siteMetadata';
import ArticleMeta from './ArticleMeta';
import Bio from './Bio';
import styles from './BlogPostLayout.module.css';
import Disqus from 'disqus-react'; // NEW_CODE

interface BlogPostLayoutProps {
    blogRoot: string;
}

function BlogPostLayout({blogRoot}: BlogPostLayoutProps) {
    let {title, data, url} = useCurrentRoute();
    let {connect, content, head} = useView()!;
    let {MDXComponent, readingTime} = content;
    /* NEW_CODE start */
    const disqusShortname = 'miaocode';
    const disqusConfig: any = {
        url: 'https://mzvast.github.io' + url.pathname,
        identifier: data.slug,
        title: title
    };
    /* NEW_CODE end */
    console.log('useCurrentRoute::title, data, url', title, data, url);
    // The content for posts is an MDX component, so we'll need
    // to use <MDXProvider> to ensure that links are rendered
    // with <Link>, and thus use pushState.
    return connect(
        <>
            {head}
            <article className={styles.container}>
                <header className={styles.header}>
                    <h1 className={styles.title}>
                        <Link href={url.pathname}>{title}</Link>
                    </h1>
                    <ArticleMeta
                        blogRoot={blogRoot}
                        data={data}
                        readingTime={readingTime}
                    />
                </header>
                <MDXProvider
                    components={{
                        a: Link,
                        wrapper: ({children}) => (
                            <div className={styles.content}>{children}</div>
                        )
                    }}
                >
                    <MDXComponent />
                </MDXProvider>
                {/* NEW_CODE start
                 */}
                <Disqus.DiscussionEmbed
                    shortname={disqusShortname}
                    config={disqusConfig}
                />
                {/* NEW_CODE end
                 */}
                <footer className={styles.footer}>
                    <h3 className={styles.title}>
                        <Link href={blogRoot}>{siteMetadata.title}</Link>
                    </h3>
                    <Bio className={styles.bio} />
                    <section className={styles.links}>
                        {data.previousDetails && (
                            <Link
                                className={styles.previous}
                                href={data.previousDetails.href}
                            >
                                ← {data.previousDetails.title}
                            </Link>
                        )}
                        {data.nextDetails && (
                            <Link
                                className={styles.next}
                                href={data.nextDetails.href}
                            >
                                {data.nextDetails.title} →
                            </Link>
                        )}
                    </section>
                </footer>
            </article>
        </>
    );
}

export default BlogPostLayout;
值得注意的是，disqusConfig 的设置，其中 url 必须跟步骤 1 中配置的相匹配，而 identifier 只要保证文章之间唯一即可。总结mdx和React天生一对，相信在disqus等生态的加持下，会绽放出更强的生命力。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← 当velop有线回程遇到了智能家居的那点事CRA polyfill（未完工） →

posts/2020-09-04-tab-communication-topic.text:
多个标签页之间通信方案-以统一登出为例September 4, 2020 • tabjavascriptcommunication • ☕️ 1 min read你可以从本文了解到工作中实际需求的举例浏览器多标签通信的几种方法及其适用场景websocketSharedWorkerstorage总结你可以从本文了解到工作中实际需求的举例浏览器多标签通信的几种方法及其适用场景工作中实际需求的举例前置条件：有一个管理系统，tab1、tab2 都登录了账户 user1。
功能：登出其中 tab1 的账户，tab2 需要自动登出。
思路：tab 之间建立 eventBus 之类的消息总线，进行广播。浏览器多标签通信的几种方法及其适用场景这篇文章提到，分为三种：websocketSharedWorkerlocalstoragewebsocketwebsocket是全双工通信，客户端和服务端处于平等地位，任意一方都可以主动发起连接。用这种方式实现 tab 间通信是用订阅广播机制，但需要一个 websocket 服务器（❌）。
大致示意如下：var ws = new WebSocket('wss://echo.websocket.org');

ws.onopen = function (evt) {
    console.log('Connection open ...');
    ws.send('everyone-logout');
};

ws.onmessage = function (evt) {
    console.log('Received Message: ' + evt.data);
    if (evt.data === 'everyone-logout') {
        // do something
    }
    ws.close();
};

ws.onclose = function (evt) {
    console.log('Connection closed.');
};
SharedWorker它是 webWorker 的一种，特殊之处是具有全局作用域, SharedWorkerGlobalScope。要使 SharedWorker 连接到多个不同的页面，这些页面必须是同源的（相同的协议、host 以及端口）。此方案不需要服务器，但不支持IE。我对 MDN 这个例子进行了魔改，实现了广播通知的功能。Tips: 要调试 worker，可以在 chrome 的 inspect 面板中进行，在 source 中可以对代码进行断点调试。// worker.js
let ports = []; // 连接池
onconnect = function (e) {
    var port = e.ports[0];
    ports.push(port); // 入池
    port.onmessage = function (e) {
        var workerResult = 'everyone-logout';
        for (const p of ports) {
            if (p === port) continue; // 当前tab要不要收到
            p.postMessage(workerResult); // 通知其他tab
        }
    };
};
// 前台js
if (!!window.SharedWorker) {
  var myWorker = new SharedWorker("worker.js");

  myWorker.port.onmessage = function(e) {
    console.log('Message received from worker');
    if (e.data==='everyone-logout';) {
     // do something
    }
  }
}
实验效果如下图：storagewindow上有一个onstorage事件可以监听storage变化，当前页面可以监听到localStorage和sessionStorage的onstorage事件，但是跨tab间只能传播localStorage的onstorage事件（这一点可以通过实验验证）。但是问题来了，这个事件如何传播消息呢？// 实现一个一次性消息广播工具
// messageBroadcast.ts
export default function messageBroadcast(message) {
    localStorage.setItem('message', JSON.stringify(message));
    localStorage.removeItem('message');
}
import messageBroadcast from '@/utils/messageBroadcast';
import {logout} from '@/utils/logout';
class LogoutGuard {
    constructor() {
        this.subscribeLogout();
    }
    subscribeLogout() {
        window.onstorage = (e: StorageEvent) => {
            if (e.key === 'message') { // 指定消息频道
                let message = JSON.parse(e.newValue);
                if (!message) return; // 不关注message删除，只关注新增
                if (message.cmd && message.cmd === 'logout') {
                    logout();
                }
            }
        };
    }
    notifyLogout() {
        messageBroadcast({
            cmd: 'logout'
        });
        logout();
    }
}

export default new LogoutGuard();
可以发现这种方式只能说是比较粗糙，如果考虑并发，健壮性是不如上面两种方法的（在工具部分要考虑实现队列依次发送消息）。但对于实现统一登出这种场景是足够的。毕竟只要发出一个，就不再需要这个订阅了，任务完成！总结在实际业务中，我选用了第三种方法。简单粗暴，直接有效。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← 从Omni Automation Plugin开发谈时间管理performance optimize rethink →

