首先这个mdx-mermaid包在package.json中定义了exports字段，其中将./lib导出成./,./lib/Mermaid.js导出成./Mermaid。
经过一番调查，发现TS还没实现这个功能。那我们就得把引用关系给改一下，接下来定位是什么地方写死的呢。改造mdx-mermailmdxast-mermaid很明显是一个babel插件，通过对代码parse再transform输出改造后的代码。可以看到visit遍历文件，如果引入了Mermai，就不处理，否则，就增加一条import记录。问题就出在这个路径ts不认。就改对就行了。diff --git a/node_modules/mdx-mermaid/lib/mdxast-mermaid.js b/node_modules/mdx-mermaid/lib/mdxast-mermaid.js
