patch-package的使用一开始我说clone了两个代码库，本地通过yalc打包发布，调通。并给作者提了issue和PR但问题是假如PR没有被合入，那如何在其他设备上同步我的“魔改”呢？下面就要请出主角patch-package,简单概括一下就是1、先在node_modules里面直接修改代码2、通过npx patch-package 包名的方式产生patch文件（根目录的patches文件夹下）3、确保package.json中的postinstall存在patch应用的代码（如下）"scripts": {
+  "postinstall": "npx patch-package" }
上面的两处修正我都是直接在node_modules里面改的，并且fork了代码库提交了issue和PR。感觉这样比用yalc修复bug的效率高多了呢。你觉得呢？OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← Two History Bugwhat we can learn from Dao Sheng He Fu →

posts/2021-12-30-1332-Migrate-Razzle-fro.text:
Migrate Razzle from 3 to 4December 30, 2021 • razzle • ☕️ 1 min read你可以从本文了解到背景过程和遇到问题更新依赖解决问题总结你可以从本文了解到背景由于我们的业务需要为 razzle 编写 plugin，而 4 版本的架构理念让一切都 plugin，显然对此提供了更好的支持。那么我们一起来看看升级的时候会遇到什么坑吧。过程和遇到问题我们演示的项目是我之前建的脚手架 demo。首先打开upgrade-guide，开始升级！更新依赖执行以下yarn add --dev \
  razzle \
  razzle-dev-utils \
  babel-preset-razzle
会将相关依赖更新到最新// package.json
{
    "devDependencies": {
        "babel-preset-razzle": "^4.2.13",
        "razzle": "^4.2.13",
        "razzle-dev-utils": "^4.2.13"
    }
}
接着安装 peerDependenciesyarn add --dev \
  webpack-dev-server@3.11.0 \
  mini-css-extract-plugin@0.9.0 \
  postcss@8.2.4
以及选择一个 webpack 版本及其插件，这里选择 4 吧。yarn add --dev webpack@4.46.0 html-webpack-plugin@4.5.2
然后准备 start 我们的 server 看能不能跑，嗯跑起来了，没有任何问题。如果你的 app 不用读取打包产物 chunks，那么升级到这里就结束了。但是，如果你的 app 用了After.js，那么可能编译会报错，提示大概是 webpack 找不到 module 'undefined’。Cannot find module 'undefined'
    at webpackEmptyContext (/Users/apple/@Projects/oss/cra-ts-ssr-zero/src sync:2:1)
    at Module../src/server.tsx (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/src/server.tsx:19:1)
    at __webpack_require__ (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:748:1)
    at fn (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:59:1)
    at Module../src/index.ts (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/src/index.ts:5:1)
    at __webpack_require__ (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:748:1)
    at fn (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:59:1)
    at Object.0 (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/server.js:1622:1)
    at __webpack_require__ (/Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:748:1)
    at /Users/apple/@Projects/oss/cra-ts-ssr-zero/build/webpack:/webpack/bootstrap:815:1
sswp> !!! Script exited with code 1
这个问题跟RAZZLE_CHUNKS_MANIFEST这个环境变量相关。我们来看After的一个demo。// ./src/server.js
import React from 'react';
import express from 'express';
import {render} from '@jaredpalmer/after';
import {renderToString} from 'react-dom/server';
import {ApolloProvider, getDataFromTree} from 'react-apollo';
import routes from './routes';
import createApolloClient from './createApolloClient';
import Document from './Document';
const chunks = require(process.env.RAZZLE_CHUNKS_MANIFEST); 
const server = express();
server
    .disable('x-powered-by')
    .use(express.static(process.env.RAZZLE_PUBLIC_DIR))
    .get('/*', async (req, res) => {
        const client = createApolloClient({ssrMode: true});

        const customRenderer = (node) => {
            const App = <ApolloProvider client={client}>{node}</ApolloProvider>;
            return getDataFromTree(App).then(() => {
                const initialApolloState = client.extract();
                const html = renderToString(App);
                return {html, initialApolloState};
            });
        };

        try {
            const html = await render({
                req,
                res,
                routes,
                chunks,                customRenderer,
                document: Document
            });
            res.send(html);
        } catch (error) {
            console.error(error);
            res.json({message: error.message, stack: error.stack});
        }
    });

export default server;
原因是process.env.RAZZLE_CHUNKS_MANIFEST这个环境变量没有被注入，require了个undefined，于是出现了上面的报错。这算是Razzle从3到4的一个breaking change吧。我们可以去看V3是从crateConfig调用了来自paths的build/chunks.json文件那怎么办呢？这个点在razzle官网的plugin的doc上并没有说明。导致用After的我当时一脸懵逼。并不知道这个东西独立成插件了。但是我们去V4看代码，发现仓库里确实有这么一个razzle-plugin-manifest这个插件，它就是做这个事情的。 webpackConfig.plugins.push(
      new webpackObject.DefinePlugin({
        'process.env.RAZZLE_CHUNKS_MANIFEST': JSON.stringify(pluginOptions.fileName),
      })
    );
解决问题可以在After的官网examples里面看到这个例子basic它使用的唯一的razzle插件就是manifest。那么解决这个问题的办法就是装上这个插件。安装yarn add --dev razzle-plugin-manifest
应用插件// razzle.config.js
module.exports = {
  plugins: ['manifest'],
};
然后就可以跑了总结升级的时候出现一些问题，需要细心定位，步步为营。OverRainbowPersonal blog by mzvast.If Nothing Changes, Nothing Is Going to Change← iCopy release new versionFix Git Merge Mis-Deleting files →

posts/2022-01-12-1915-iCopy-release-new-.text:
iCopy release new versionJanuary 12, 2022 • iCopy • ☕️ 2 min read你可以从本文了解到iCopy 背景execCommand vs clipboard APIgist 的实用小技巧你可以从本文了解到iCopy 背景iCopy是一个用于 Chrome 浏览器的 js 插件，主要用于帮助开发者在某些 CASE 网站中方便的复制和格式化 git commit msg。原先的 CASE 复制工作流程如下graph TD;
    CASE网站--复制API-->剪贴板;然鹅，由于 CASE 网站复制的格式不符合 git 的要求，比如我们遵循 angular 的规范，那就需要改这个 msg，这时候 iCopy 就上场了。用了 iCopy 的工作流程graph TD;
    CASE网站--拦截复制API调用并修改内容-->剪贴板;说白了就是做剪贴板的拦截。CASE 网站将内容复制到剪贴板，常用的一般有两种方法。1、execCommand 旧的，MDN 不推荐使用2、Clipboard API 新版本 CASE 网站调用execCommand vs clipboard API所以可以推测因为 execCommand 接口不推荐使用了，所以 CASE 网站改造成了用 Clipboard API。那 clipboard API 有什么好处呢？直观的可以感受一下两段代码// execCommand
export default function copyToCb(text) {
    const input = document.createElement('textarea');
    input.setAttribute('readonly', 'readonly');
    input.value = text;
    document.body.appendChild(input);
    input.select();
    input.setSelectionRange(0, 9999);
    document.execCommand('copy');
    document.body.removeChild(input);
    return Promise.resolve();
}
// clipboard API
var promise = navigator.clipboard.writeText(newClipText);
代码量出现了肉眼可见的下降。此外，clipboard返回的是promise，解锁了更现代的调用方式。拦截 execCommand 的姿势const _execCommand = document.execCommand; // 原方法

// 劫持
document.execCommand = async function (evtName) {
    if (evtName === 'copy') {
        console.log('enter exec');
        // 由于前者使用必须要selection然后exec copy
        // 获取选中部分
        const text = window.getSelection().toString();
        main(text); // 格式化text并最终调用了copyText
    }
};

const copyText = (text) => {
    const el = document.createElement('textarea');
    el.value = text;
    document.body.appendChild(el);
    el.select();
    _execCommand('copy'); // 调用原方法
    document.body.removeChild(el);
    console.log('copied:', text);
};
execCommand 比较清晰就不解释了。拦截 clipboard API 的姿势const _writeText = navigator.clipboard.writeText; // save for later use

const copyText = (text) => {
    // this得指向navigator.clipboard实例
    _writeText.call(navigator.clipboard, text);
};
writeText 劫持这里有一个坑，就在于如果直接使用，会报错，大致内容是typeError找不到Clipboard.navigator.clipboard.writeText的这个方法_writeText(text);
这比较让人费解，为什么会是Clipboard的的writeText方法呢？为什么是typeError呢？这就不得不研究一下这个方法究竟在做什么。首先打开Chromium的clipboard部分源码ScriptPromise Clipboard::writeText(ScriptState* script_state,
                                   const String& data) {
  return ClipboardPromise::CreateForWriteText(GetExecutionContext(),
                                              script_state, data);
}

// static
ScriptPromise ClipboardPromise::CreateForWriteText(ExecutionContext* context,
                                                   ScriptState* script_state,
                                                   const String& data) {
  if (!script_state->ContextIsValid())
    return ScriptPromise();
  ClipboardPromise* clipboard_promise =
      MakeGarbageCollected<ClipboardPromise>(context, script_state);
  clipboard_promise->GetTaskRunner()->PostTask(
      FROM_HERE, WTF::Bind(&ClipboardPromise::HandleWriteText,
                           WrapPersistent(clipboard_promise), data));
  return clipboard_promise->script_promise_resolver_->Promise();
}

void ClipboardPromise::HandleWriteTextWithPermission(PermissionStatus status) {
  DCHECK_CALLED_ON_VALID_SEQUENCE(sequence_checker_);
  if (!GetExecutionContext())
    return;
  if (status != PermissionStatus::GRANTED) {
    script_promise_resolver_->Reject(MakeGarbageCollected<DOMException>(
        DOMExceptionCode::kNotAllowedError, "Write permission denied."));
    return;
  }
  SystemClipboard* system_clipboard = GetLocalFrame()->GetSystemClipboard();  system_clipboard->WritePlainText(plain_text_);
  system_clipboard->CommitWrite();
  script_promise_resolver_->Resolve();
}
稍微梳理了一下调用关系graph TD;

 ClipboardPromise::CreateForWriteText--> ClipboardPromise::HandleWriteText--> ClipboardPromise::HandleWriteTextWithPermission-->GetSystemClipboard--> WritePlainText_plain_text-->
  system_clipboard_CommitWrite-->
  script_promise_resolver_Resolve流程比较清晰，我们重点关注这个GetLocalFrame()方法。因为问题就出在这个文件这里发生了一个强转，将this转成了system_clipboard_，所以错误提示显示的是typeError（cpp的部分出错了）。而不是js的错误（js根本没有type这个词汇）。看了这个代码之后，我很清楚，只要在调用的时候确保this是正确的clipboard的实例就行了。那么谁才是clipboard的实例呢？答案是navigator.clipboard。题外话：浏览器全局对象里面有一个Clipboard，他是这个实例的构造函数，host在适当的时候会创建它的实例（lazy）此外，有同学就会问了，那么为什么execCommand不报错呢？
主要是默认的this指向了window，而execCommand内部contentWindow.document.execCommand
