how to debug react without painNovember 7, 2020 • reactwebpack • ☕️ 2 min read如何愉快的调试react原有方案：store端push，app端pull新方案：整合package到app端，live-reload实现Step1 BaseStep2 下载源码，魔改configStep3 修复报错linter配置修改总结和最终代码如何愉快的调试reactReact是一个huge code base。研究它，有许多方法。我希望可以一边开着一个app（SPA？），这个app引入一个本地的react，在里面搞事情，并可以实时看到效果。思路主要是在于两端（app端和store端）如何链接起来。原有方案：store端push，app端pull我在之前主要用yalc改包发布到本地store，app引入yalc的store中的react。这样的好处是完全不需要修改app编译的过程，但是build，push package，pull package，pull，restart，restart 的4步走过程并算不上友好。（只适用于简单的调试，频繁的修改会shi的）新方案：整合package到app端，live-reload如果修改webpack打包过程，让app识别这一个package副本（webpack alias），并借助hmr能力，使得修改源码可以实时生效。岂不是很美？当然，这也并不是什么新技术，只是整合一下已有的技术。实现Step1 Base首先需要一个solid的基础，毫无疑问，选择最新版CRA，并且eject。npx create-react-app debug-react-ts --template typescript
