performance optimize rethinkAugust 28, 2020 • reactperformanceimage • ☕️ 4 min read你可以从本文了解到以下方面的优化思路背景优化策略图片字体长列表虚拟渲染-原理优先加载问题描述方案原理如何正确抛弃还可以改进的地方总结对于问题对于某个具体技术你可以从本文了解到以下方面的优化思路图片字体长列表优先加载背景在混合 H5 项目 A 中，有一个大量图片的信息流页面，并且需要在多个 Tab 切换。如下图所示（已脱敏）。存在的问题主要有：图片尺寸大，下载慢。非常占用 Android 壳的缓存，约 70–80M。 切换 Tab 卡（尤其在长列表间切换的时候） 自定义字体占据 30M，字体 swap 时间长 长列表越往下滑动越卡。优化策略图片核心：体积控制尺寸在看得清的情况下尽可能小(size 够用就行)高压缩比格式（quality 能接受就行）尽可能少的研发方案 1 （❌）自己压缩全部图片
优点：自主可控
缺点：灵活性差和研发部署成本高方案 2（✅）使用第三方图片存储的实时处理能力（百度云 BOS）优点：灵活性好和研发部署成本低
缺点：相对低的可控性效果加载速度提升 26 倍，体积缩小 95%代码片段import canUseWebP from './canUseWebP';
//BOS 图片优化 https://cloud.baidu.com/doc/BOS/s/Zk2l2mq0v

// small 350
// mid 640
// large 1280
// size向上靠拢，尽可能应用缓存
const getLevelUpSize = (size: number) => {
    if (size <= 350) {
        return 350;
    } else if (size <= 640) {
        return 640;
    } else {
        return 1280;
    }
};

const getBosPicUrl = (src, sizeInPx = Infinity, ImgQuality = 50) => {
    const isBosPic = src.indexOf('bcebos') !== -1;
    if (!isBosPic) return src; // 不是bos图，不处理
    const format = canUseWebP ? 'f_webp' : 'f_jpg';
    const dpr = window.devicePixelRatio;
    const size = 'w_' + Math.floor(getLevelUpSize(sizeInPx) * dpr);
    const quality = 'q_' + ImgQuality;
    // const display = 'd_progressive';
    const command = [size, format, quality].join(',');
    return `${src}@${command}`;
};

export default getBosPicUrl;
