长列表虚拟渲染-原理只渲染用户视口区域的元素，其他区域仅撑开高度保持滚动条位置准确。在 React 下面可以采用react-window.简单看一下react-window核心数据结构type ItemMetadata = {|
  offset: number, // 当前item距离屏幕顶部的距离
  size: number, // 当前item的高度
|};
