我们需要提供的数据itemData（列表全数据）滚动事件（一方面组件内部使用），控制回到顶部小火箭的显隐。itemKey 方法，确定每个元素在 list 中唯一的标识符号（react 渲染用）itemSize 方法，获取每个元素的 height
基于这些，虚拟渲染组件会合成一个 itemMetadataMap.从 List 到 Gird业务需要对内容定制。一个是横高度不固定，底部会有菊花。所以对内容的类型进行了分类。Array：一行卡片。其中每个卡片的类型是FEED_ITEM，4个一行，计算生成。
FEED_SUBJECT：XX标题
TOP_MARGIN：顶部占位块（纯布局用）
FEED_LOADER：底部更多菊花
// list数据模型的生成
getRowData = () => {
    const {activeKey, tabsData} = this.props;
    const list = tabsData[activeKey];
    let rowData = [];
    rowData.push({
        type: ELEMENT_TYPES.TOP_MARGIN,
    });
    for (let i = 0; i < list.length; i++) {
