}, areEqual);

// 计算行高
getItemSize = (index) => {
    const row = this.rowData[index];
    if (row instanceof Array) {
        return (16.44 + 2) * window['remBase'];
    } else if (row.type === ELEMENT_TYPES.FEED_SUBJECT) {
