目前没有严格准确的结论，但对图片压缩尺寸后，闪烁就消失了（png压缩后损失alpha通道，丢失透明度）。初步结论 edge 渲染效能有问题。2.不规则闪烁与浏览器无关，都会发生。在刷新页面或者切页面时容易出现，主要原因是“重入”。webpack 与调试 es5参考本文，通过修改 webpack 的 dev server 配置，使得client使用webpack/hot/dev-server，可以实时编译成 es5 给 IE 调试。 提高了调试效率，尤其是IE11。问：webpack/hot/dev-server怎么知道该编译成 es5？答：基于package.json的browserslist配置。源码对应的位置：// node_modules/razzle/config/createConfig.js
